import Link from "next/link";
import Layout from "../comps/MyLayout";

const PostLink = props => {
    return (
        <li>
            <Link href={'/post/p[id]'} as={`p/${props.id}`}>
                <a>{props.id}</a>
            </Link>
        </li>
    )
};

function Index() {
    return (
        <Layout>
            <p>Hey, this the layout component!</p>
            <ul>
                <PostLink id="Hello"/>
                <PostLink id="Byeeee"/>
                <PostLink id="Hello goodbyeeeee"/>
            </ul>
        </Layout>
    )
}

